import React from 'react'
import styled from 'styled-components'

const CoinRow = ({ name, symbol, quantity, image }) => {
    console.log(name)
    return (
        <CoinRowContainer>
            <div className="row">

                <h1>{name}</h1>
                <h1>{symbol}</h1>
                <p>{quantity}</p>
            </div>

        </CoinRowContainer>
    )
}

export default CoinRow

const CoinRowContainer = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;


    .row {
        display: flex;

    }
`
